window.bookSummaryJSON = "The new novel in the hit <i>New York Times</i> best-selling Dresden Files series. <p>The Warden Morgan has been accused of treason against the Wizards of the White Council - and there's only one, final punishment for that crime. He's on the run, wants his name cleared, and needs someone with a knack for backing the underdog. Someone like Harry Dresden....</p> <p>Now, Harry must uncover a traitor within the Council, keep a less-than-agreeable Morgan under wraps, and avoid coming under scrutiny himself. And a single mistake may cost someone his head - someone like Harry</p>"; 
